import Social_inline from "./Social_inline";
import logo from "../assets/Got7_2022_logo.png";
import { height } from "@mui/system";

function Discography(params) {
  return (
    <>
      <style>
        {`
          html, body {
            background-color: #F3F6F4;
          }
        `}
      </style>
      <div className="app">
        <Social_inline />
        <div
          className="head-logo"
          style={{
            display: "flex",
            height: "60px",
            justifyContent: "center",
            position: "relative",
            marginTop: "-50px",
          }}
        >
          <img src={logo}></img>
        </div>
        <div className="notice-heading">
          <h1
            style={{
              textAlign: "center",
              marginTop: "60px",
              color: "#3C8350",
              fontSize: "38px",
            }}
          >
            DISCOGRAPHY
          </h1>
        </div>
        <div
          className="disc-body"
          style={{
            backgroundColor: "white",
            width: "80%",
            height: "300px",
            display: "flex",
            marginTop: "50px",
            display: "flex",
            justifyContent: "center",
            alignItems: "center",
            margin: "50px auto",

          }}
        >
          <div className="disc-show-pop">
            <div className="album-01" style={album_part}>
                <div className="album-cover">
                    <img src="https://blogger.googleusercontent.com/img/a/AVvXsEh9oMSuhEV74m2MwTvFV7z_EJ8fjZQLgAIlSdEjX4meg8U6aVCv7SvDihAjja7PEOFDK4DEG23GtH1V437Q2zISv5X9oYt8PrUdw1B5uAIsuczI4ZgM8j24vPNAW-lPg4G96v9SoN4UkHL0YdBl1joNRVt1EqDuXCEsShTPirVJYOioqUeihUXXhZOG"
                    alt="got7isourname"
                    style={album_cover}></img>
                </div>
                <div className="name-album">

                </div>
            </div>
          <div className="disc-all">
            <div className="dis-id-01"></div>
          </div>
          </div>
        </div>
      </div>
    </>
  );
}
export default Discography;

const album_part = {
    borderRadius:"5px",
};

const album_cover = {
    width:"150px",
    height:"150px",
    borderRadius:"5px"
};
